// Handles the transaction start event.
function onTransactionStarted() {
    var rowId = "";
    var strConst = "spreadsheets.google.com/feeds/list/" + key + "/" + worksheetID + "/";
    var i = listRowIdUrl.indexOf(strConst);
    if (listRowIdUrl != null && i != -1) {
        // splitting the URL to retrieve the list row ID
        rowId = listRowIdUrl.substring(i + strConst.length, listRowIdUrl.length);
    }
    context.addTextNodeUnderRoot("listRowId", rowId);
    return "cancel";
}

