// Handles the transaction start event.
function onTransactionStarted() {
    // get the header function from the context and call it
    var func = context.get("GoogleHeader");
    if (func == null){
       context.addTextNodeUnderRoot("expiryError", "The context has expired, you're not authenticated anymore.");
       return "cancel";     
    }
    func(null);

	// override host based url
	var connector = context.getConnector();
	connector.sUrl = "https://spreadsheets.google.com/feeds/list/" + key + "/" + worksheetID + "/private/full";
}

